//Import relevent Excel Library
import java.io.*
import jxl.*
def groovyUtils = new com.eviware.soapui.support.GroovyUtils(context)
def projectPath = groovyUtils.projectPath //gets the path of the project root
// -------------------------------------------------------------
// Defining âgroovyUtilsâ to access the utility methods of GroovyUtils class
// -------------------------------------------------------------
//def holder = groovyUtils.getXmlHolder(&quot;CheckDomainCommand#Response&quot;)
log.info projectPath
try{

//Define Dynamic type Object fs to point to the Excel file  
def fs = new File(projectPath,"/TestData/TestDataforCal.xls")
//Define Dynamic type Object wb to point to the Excel workbook  
def wb = Workbook.getWorkbook(fs)
def ws = wb.getSheet("Sheet1")
def r = ws.getRows()
for (def i=0; i<r; i++)
	{	
		def row = ws.getRow(i)
//		log.info row
		Cell c1 = ws.getCell(2,i)
//	     log.info c1.getContents()
		if (c1.getContents().equalsIgnoreCase("Y"))
			{
				Cell c2 = ws.getCell(3,i)
				log.info c2.getContents()
				testRunner.testCase.testSuite.setPropertyValue("TestData1",c2.getContents())
				Cell c3 = ws.getCell(4,i)
				log.info c3.getContents()
				testRunner.testCase.testSuite.setPropertyValue("TestData2",c3.getContents())
				Cell c4 = ws.getCell(1,i)
				testRunner.runTestStepByName(c4.getContents())
				log.info c4.getContents()	
			}
		}



def now = new java.util.Date() //getting current time
String date = now.format("dd-MM-YY-HH_mm_ss")
String day = now.format("YYYY-dd-MM")+"-LOGS"
String time = now.format("HH-mm-ss")
//def testCase =context.getProperty("#CallingTestCaseRunner#").getTestCase().name.toString()
def projectDir = groovyUtils.projectPath+"/" //getting project path 


//def logMonitor = com.eviware.soapui.SoapUI.logMonitor
//log.info logMonitor=!null

def logArea
def errorlog
def soapuilog
if (com.eviware.soapui.SoapUI.logMonitor!=null){
logArea=com.eviware.soapui.SoapUI.logMonitor.getLogArea("script log")
errorlog=com.eviware.soapui.SoapUI.logMonitor.getLogArea("error log")
soapuilog=com.eviware.soapui.SoapUI.logMonitor.getLogArea("SoapUI log")
//def logArea = com.eviware.soapui.SoapUI.logMonitor.getLogArea( "script log" )
}


def LogFile = "ScriptLogs-"+time+".log"
def ErrorFile = "ErrorLogs-"+time+".log"
def SoapuiFile = "SoapULogs-"+time+".log"

log.info LogFile
def dayfolder = new File(projectDir+day)
// If it doesn't exist
if( !dayfolder.exists() ) {
  // Create all folders up-to and including B
  dayfolder.mkdirs()
}

LogFiles = new File( dayfolder,LogFile)
LogFiles.createNewFile() //build the file 

if(logArea !=null)
{
def model = logArea.model
if(model.size > 0) {
for(c in 0..(model.size-1))
{
LogFiles.append(model.getElementAt(c).toString() + "\r\n")
}
}
}

errorfiles = new File( dayfolder,ErrorFile)
errorfiles.createNewFile() //build the file 

if(logArea !=null)
{
def model = errorlog.model
if(model.size > 0) {
for(c in 0..(model.size-1))
{
errorfiles.append(model.getElementAt(c).toString() + "\r\n")
}
}
}

soapuifiles = new File( dayfolder,SoapuiFile)
soapuifiles.createNewFile() //build the file 

if(logArea !=null)
{
def model = soapuilog.model
if(model.size > 0) {
for(c in 0..(model.size-1))
{
soapuifiles.append(model.getElementAt(c).toString() + "\r\n")
}
}



}
}
catch (Exception e){
////// -------------------------------------------------------------
////// Catching exception and writing it to error log if TS01 sen res1, ts2 send resp mock is only one, 
////// -------------------------------------------------------------

	log.error(e)
}

con:mockOperation.con:dispatchPath:
/*Script to Simulate Dynamic Behaviour*/
import com.eviware.soapui.support.*
try
{

def request = new XmlSlurper().parseText(mockRequest.requestContent)
def a = request.Body.Add.intA.toDouble()//it will catch exception if its not number
def b = request.Body.Add.intB.toDouble()
context.result = a+b

def step = context.testCase.testSteps['Properties']
//check if the response is not empy
assert context.response, 'Response is empty or null'
//Parse the xml
def parsedXml = new XmlSlurper().parseText(context.response)
//def langs = new XmlParser().parse("languages.xml")
println "type = ${parsedXml.attribute("type")}"
parsedXml.language.each{
  println it.text()
  lon.info it.text()
}

//Get the all the error details from the response as map
def errorDetails = parsedXml.'**'.findAll { it.name() == 'IntegrationServiceErrorCode'}.inject([:]){map, entry ->    map[entry.ErrorCode.text()] = entry.Description.text(); map    }
log.info "Error details from response  : ${errorDetails}"

//loop thru xml error codes and verify against the properties of Properties Test Step
errorDetails.each { key, value ->
    assert step.properties[key]?.value == value, "Unable to match value of the property ${key} "
}
}
catch (Exception e){

log.info "exception reached Pradeep"
}

